PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE ab_permission (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE ab_view_menu (
	id INTEGER NOT NULL, 
	name VARCHAR(250) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE ab_role (
	id INTEGER NOT NULL, 
	name VARCHAR(64) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE ab_user (
	id INTEGER NOT NULL, 
	first_name VARCHAR(64) NOT NULL, 
	last_name VARCHAR(64) NOT NULL, 
	username VARCHAR(64) NOT NULL, 
	password VARCHAR(256), 
	active INTEGER, 
	email VARCHAR(64) NOT NULL, 
	last_login timestamp, 
	login_count INTEGER, 
	fail_login_count INTEGER, 
	created_on timestamp, 
	changed_on timestamp, 
	created_by_fk INTEGER, 
	changed_by_fk INTEGER, 
	PRIMARY KEY (id), 
	UNIQUE (username), 
	UNIQUE (email), 
	FOREIGN KEY(created_by_fk) REFERENCES ab_user (id), 
	FOREIGN KEY(changed_by_fk) REFERENCES ab_user (id)
);
CREATE TABLE ab_register_user (
	id INTEGER NOT NULL, 
	first_name VARCHAR(64) NOT NULL, 
	last_name VARCHAR(64) NOT NULL, 
	username VARCHAR(64) NOT NULL, 
	password VARCHAR(256), 
	email VARCHAR(64) NOT NULL, 
	registration_date timestamp, 
	registration_hash VARCHAR(256), 
	PRIMARY KEY (id), 
	UNIQUE (username)
);
CREATE TABLE ab_permission_view (
	id INTEGER NOT NULL, 
	permission_id INTEGER, 
	view_menu_id INTEGER, 
	PRIMARY KEY (id), 
	UNIQUE (permission_id, view_menu_id), 
	FOREIGN KEY(permission_id) REFERENCES ab_permission (id), 
	FOREIGN KEY(view_menu_id) REFERENCES ab_view_menu (id)
);
CREATE TABLE ab_user_role (
	id INTEGER NOT NULL, 
	user_id INTEGER, 
	role_id INTEGER, 
	PRIMARY KEY (id), 
	UNIQUE (user_id, role_id), 
	FOREIGN KEY(user_id) REFERENCES ab_user (id), 
	FOREIGN KEY(role_id) REFERENCES ab_role (id)
);
CREATE TABLE ab_permission_view_role (
	id INTEGER NOT NULL, 
	permission_view_id INTEGER, 
	role_id INTEGER, 
	PRIMARY KEY (id), 
	UNIQUE (permission_view_id, role_id), 
	FOREIGN KEY(permission_view_id) REFERENCES ab_permission_view (id), 
	FOREIGN KEY(role_id) REFERENCES ab_role (id)
);
CREATE TABLE IF NOT EXISTS "plays" (
	"id"	INTEGER,
	"date"	TEXT,
	"away_team"	TEXT,
	"home_team"	TEXT,
	"home_spread"	REAL,
	"home_spread_price"	INTEGER,
	"away_moneyline"	INTEGER,
	"home_moneyline"	INTEGER,
	"bet"	TEXT,
	"wager"	REAL,
	"away_score"	INTEGER,
	"home_score"	INTEGER,
	"result"	TEXT,
	"profit"	INTEGER,
	"total_plays"	INTEGER,
	"total_wins"	INTEGER,
	"total_losses"	INTEGER,
	"total_pushes"	INTEGER,
	"total_profit"	INTEGER,
	"total_ats"	INTEGER,
	"total_moneyline"	INTEGER,
	"total_moneyline_wins"	INTEGER,
	"total_moneyline_losses"	INTEGER,
	"total_moneyline_pushes"	INTEGER,
	"total_moneyline_profit"	INTEGER,
	"total_ats_wins"	INTEGER,
	"total_ats_losses"	INTEGER,
	"total_ats_pushes"	INTEGER,
	"total_ats_profit"	INTEGER,
	"total_2u_wins"	INTEGER,
	"total_2u_losses"	INTEGER,
	"total_2u_pushes"	INTEGER,
	"total_2u_profit"	INTEGER,
	PRIMARY KEY("date","bet")
);

COMMIT;
